import React from "react";

function CreateTicket() {
  return (
    <div className="container">
      <div className="row">
        <h1 className="fs-2 text-center">
          To create a ticket, select a relevant topic
        </h1>
        <div className="row">
          <h1>Account Opening</h1>
        </div>
      </div>
    </div>
  );
}

export default CreateTicket;
